import Link from "next/link";

const Logo = () => (
  <div>
    <div className="logo" style={{ fontFamily: "Sectra" }}>
      <Link href="/">
        <a className="logo-letter">O</a>
      </Link>
    </div>
    <style jsx>{`
      .logo-letter {
        color: var(--color2);
      }
      .logo {
        font-size: 3rem;
        color: var(--color2);
        margin-left: var(--global-margin);
        margin-top: 1rem;
      }
    `}</style>
  </div>
);

export default Logo;
